import React from "react";
import TaskTiles from "./TaskTiles.js";


const OngoingTasksHome = (props) => {
  const moreButton = props.button;

  return (
        <TaskTiles moreButton={moreButton}></TaskTiles>
       
  );
};

export default OngoingTasksHome;
